ll pi_fast(ll n) {
    ll cnt;
    ll quant = DUZO / DIV;
    ll current = 0;

    while((current + 1) * quant <= n)
        current++;

    cnt = pre[current];
    for(ll i = current * quant; i <= n; i++)
        if(is_prime(i))
            cnt++;

    return cnt;
}

ll pi_brute(ll n) {
    ll cnt = 0;

    for(ll i = 2; i <= n; i++) {
        if(is_prime(i))
            cnt++;
    }

    return cnt;
}

bool is_prime_brute(ll n) {
    if(n < 2)
        return false;

    for(ll i = 2; i * i <= n; i++) {
        if(n % i == 0)
            return false;
    }

    return true;
}

void preprocess() {
    vector<ll> res;

    ll quant = DUZO / DIV;
    ll current_result = 0;
    for(ll i = 1; i <= DIV; i++) {
        for(ll j = (i - 1) * quant; j < i * quant; j++) {
            if(is_prime(j))
                current_result++;
        }

        res.push_back(current_result);
    }

    printf("ll pre[%d] = {", res.size());
    for(int i = 0; i < res.size(); i++)
        printf("%lld, ", res[i]);
    printf("};\n");
}

ll qpower(ll a, ll x, ll mod) {
    if(x == 0)
        return 1;

    if(x % 2 == 1)
        return (a * qpower(a, x-1, mod)) % mod;

    ll res = qpower(a, x/2, mod);
    return (res * res) % mod;
}

bool is_prime(ll n) {
    if(n == 2 || n == 3 || n == 5)
        return true;

    if(n < 5 || n % 2 == 0 || n % 3 == 0 || n % 5 == 0)
        return false;

    for(int i = 0; i < witnesses.size(); i++) {
        if(witnesses[i] >= n)
            continue;

        if(n == witnesses[i])
            return true;

        if(!is_probably_prime(n, witnesses[i]))
            return false;
    }

    return true;
}

bool is_probably_prime(ll n, ll witness) {
    ll s = 0;
    ll d = n - 1;

    while(d % 2 == 0) {
        s++;
        d /= 2;
    }

    ll res = qpower(witness, d, n);
    if(res == 1)
        return true;

    for(ll i = 0; i < s; i++) {
        if(res == n - 1)
            return true;

        res *= res;
        res %= n;
    }

    return false;
}

